style.css:
/* AGENT_SHEET */
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

#appmenu-toolbar-button {
background: url("chrome://branding/content/identity-icons-brand@2x.png")2px 0  !important;
height: 24px !important;
width:36px !important;
-moz-appearance: none !important;
}

#appmenu-toolbar-button:hover {
 opacity: 1 !important;
 -moz-transition-duration: 0.5s !important;
}

#appmenu-toolbar-button > .toolbarbutton-text,
#appmenu-toolbar-button > .toolbarbutton-menu-dropmarker {
 display: none !important;
}
#nav-bar{
    background:-moz-linear-gradient(top,#e7e7e7,#dfdfdf)!important;
    border-bottom:1px solid #ccc!important;
    padding:0!important;
}
#TabsToolbar{
	background:#2d2d2d!important;
	}
.tabbrowser-tab,.tabs-newtab-button{
	padding:0 4px!important;
    color:#777777!important;
	background:#b1b1b1!important;
	-moz-border-image:url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAIAAACQd1PeAAAABmJLR0QA/wD/AP+gvaeTAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH3QsPFRYkd7G0iwAAAAxJREFUCNdjKC8vBwACzgFm4Xl92wAAAABJRU5ErkJggg==)0 0 0 1/0px 0px 0px 1px repeat stretch!important;
	border-radius:0!important;
	}
.tabbrowser-tab[selected="true"]{
    color:#555555!important;
    padding: 4px 9px 0px 10px!important;
	background:#e7e7e7 -moz-linear-gradient(top,#d64937 2px,#e7e7e7 1px)!important;
	background-repeat: no-repeat!important;
	border-top:0px!important;
	border-left: 0px!important;
    border-right: 0px!important;
	}
.toolbarbutton-1{
	-moz-appearance:none!important;
	border:none!important;
	}
.toolbarbutton-1:not([disabled="true"]):hover{
	background:#cacaca!important;
	}
.toolbarbutton-1:not([disabled="true"]):active{
	background:-moz-linear-gradient(bottom,#9d9d9d 4px,#cacaca 4px)!important;
	}
scrollbar{
	-moz-appearance:none!important;	
}
scrollbar[orient="vertical"]{
	width:11px!important;
	background:-moz-linear-gradient(top,#fff 3px,transparent 3px),-moz-linear-gradient(bottom,#fff 3px,transparent 3px),-moz-linear-gradient(left,#fff 5px,rgba(0,0,0,.2)5px,rgba(0,0,0,.2)6px,#fff 6px)!important;
	}
scrollbar[orient="horizontal"]{
	height:11px!important;
	background:-moz-linear-gradient(left,#fff 3px,transparent 3px),-moz-linear-gradient(right,#fff 3px,transparent 3px),-moz-linear-gradient(top,#fff 5px,rgba(0,0,0,.2)5px,rgba(0,0,0,.2)6px,#fff 6px)!important;
	}
scrollbar thumb{
	-moz-appearance:none!important;
	background-color:transparent!important;
	}
scrollbar thumb[orient="vertical"]{
	min-height:30px!important;
	-moz-border-image:url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAsAAAAeCAYAAAD6t+QOAAAABmJLR0QA/wD/AP+gvaeTAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH3QsPFTgSswwoPgAAAEBJREFUOMtj/P//PwOxgImBBECSYhZkzjUP0x0MDAzuSEI7tXac9sBlsjs+Pu3cPKp4VPGoYpor3omPzzg4ii8Akv4NN8SFDqMAAAAASUVORK5CYII=)
	   4 5 4 6/4px 5px 4px 6px stretch!important;
	}
scrollbar thumb[orient="vertical"]:hover,scrollbar thumb[orient="vertical"]:active{
	-moz-border-image:url(data:image/png;base64,)
	   4 5 4 6/4px 5px 4px 6px stretch!important;
	}
scrollbar thumb[orient="horizontal"]{
	min-width:30px!important;
	-moz-border-image:url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAB4AAAALCAYAAABoKz2KAAAABHNCSVQICAgIfAhkiAAAAENJREFUOI1j/P//P8NAAKYBsXUgLWZB5lzzMN3BwMDgTiO7dmrtOO0B46D7mFaWYpg98uIY3eKdNLQLxWzG0XxMLwAAtQQNEVeq/rgAAAAASUVORK5CYII=)
	   6 4 5 4/6px 4px 5px 4px stretch!important;
	}
scrollbar thumb[orient="horizontal"]:hover,scrollbar thumb[orient="horizontal"]:active{
	-moz-border-image:url(data:image/png;base64,)
	   6 4 5 4/6px 4px 5px 4px stretch!important;
	}
.tab-throbber[progress]{
	list-style-image:url(data:image/png;base64,)!important;
	}
